import React from "react";
import styles from "./Story.module.css";
export const Story = (props) => {
  return (
    <div
      className={`${styles.story} ${
        props.order % 2 !== 0
          ? styles["story__even-order"]
          : styles["story__odd-order"]
      }`}
    >
      <div className={styles["stories__story-img"]}>
        <img src={props.story.img} alt="story" />
      </div>
      <div className={styles['stories__story-details']}>
        <h3>
          {props.story.period}
          <br />
          {props.story.title}
        </h3>
        <p>{props.story.story}</p>
      </div>
    </div>
  );
};
